           foaf:name "'A' Battery, Royal Australian Artillery"@en ;
           dbo:country dbr:Australia .

  ?war a dbo:SocietalEvent, dbo:MilitaryConflict ;
       dbo:militaryUnit ?battery .

  ?war dbo:commander ?commander .

  # Step 3: Determine the military force of the war associated with the awardee of British South Africa Company Medal
  ?medalAwardee a dbo:Person ;
                dbo:award dbr:British_South_Africa_Company_Medal .

