        dbo:militaryUnit ?battery ; # Assuming the same battery is involved in both wars
        dbo:commander ?medalAwardee .

  ?battleOfWarForce a dbo:Battle ;
                    dbo:battle ?war2 .

  # Ensure all conditions are met
  FILTER(?battleOfAtbara = ?battleOfWarForce)
}
